INSERT INTO `information_object_i18n` VALUES (NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'en'),('Teste',NULL,NULL,'teste',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,444,'en'),('Universidade AVMB',NULL,NULL,'Papel.\nDigital.\nEletrônico.','Os documentos de guarda permanente custodiados pelo Arquivo Central foram recolhidos ao antigo Centro de Documentação, criado em 1986 como Centro de Documentação e Arquivo da Universidade da AVMB (CEDAQ) pelo Ato da Reitoria Nº 345/86 de agosto de 1986. Foi constituído como Centro de Documentação (CEDOC) pelo Ato da Reitoria Nº 596/88, de 24 de outubro de 1988.\nA Resolução do Conselho Universitário nº 0002, de 19 de fevereiro de 2014, publicada no Diário Oficial da União em 26 de fevereiro de 2014 extinguiu o Centro de Documentação e a Subsecretaria de Comunicação Administrativa (SCA) e criou o Arquivo Central. O Regimento Interno do ACE foi aprovado pela Resolução do Conselho Universitário nº19, de 24 de julho de 2015 e publicado no Diário Oficial da União em 29 de julho de 2015.\n\nA Universidade de AVMB foi inaugurada em 15 de dezembro de 1995. Atualmente, possui 2.445 professores, 2.630 técnicos-administrativos e 28.570 alunos regulares e 6.304 de pós-graduação. É constituída por 26 institutos e faculdades e 21 centros de pesquisa especializados.\nOferece 109 cursos de graduação, sendo 31 noturnos e 10 a distância. Há ainda 147 cursos de pós-graduação stricto sensu e 22 especializações lato sensu. Os cursos estão divididos em quatro campi espalhados pelo Rio Grande do Sul: Sede (Santa Maria), Brasília, São Paulo e Porto Alegre. Os órgãos de apoio incluem o Hospital Universitário, a Biblioteca Central, o Hospital Veterinário e a Fazenda Água Limpa.',NULL,'A documentação custodiada pelo Arquivo Central da UAVMB conta com documentos administrativos e acadêmicos como resultado das atividades da Universidade. Existem no fundo, documentos que remetem à criação da Universidade, mas de forma estruturada e como mais pesquisados existe a série Atos, Resoluções e Instruções (ARINS) produzida pelo Gabinete do Reitor, Conselhos e Decanatos e outras unidades administrativas. Existem ainda atas de reuniões e alguns documentos da atividade acadêmica produzidos pela Escola de Extensão e pela Secretaria de Administração Acadêmica. «',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,519,'pt_BR'),('Reitoria',NULL,NULL,NULL,NULL,NULL,'A seção reitoria reúne os documentos do gabinete da reitoria e da vice-reitoria. Tendo com isso os documentos de arquivo acumulados nas atribuições do Reitor e do Vice-Reitor da Universidade.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,522,'pt_BR'),('Gabinete do Reitor',NULL,NULL,'Papel e cópias digitais. Gênero textual: 10,5 metros lineares de documentos em suporte papel (75 caixas arquivo).\nOs atos, resoluções e instruções produzidos até o dia 16 de maio de 2016 estão no Arquivo Central, a partir desta data os documentos passaram a ser produzidos pelo SEI. Os atos do ano de 2017 estão sendo inseridos e descritos nesta plataforma pelo Centro de Informática.','O Gabinete do Reitor tem por finalidade propiciar ao Reitor, diretamente, os elementos necessários ao exercício de suas funções. Criado por ocasião da Lei nº 3.998 de 15 de dezembro de 1961 que autoriza o Poder Executivo a instituir a Fundação Universidade de Brasília.',NULL,'Os documentos dessa série abrangem os atos, resoluções e instruções emanados pelo Gabinete do Reitor.\nO conjunto é composto por atos da Reitoria que tratam de assuntos relativos à representação da universidade, alteração da estrutura administrativa e acadêmica, administração de finanças, exercício do poder disciplinar, delegação de atribuições, apresentação de projetos e propostas, dispensa, recondução e admissão de pessoal docente e técnico-administrativo, designação de chefes superiores, promoção, extinção e criação de cargos, aplicação de penas de suspensão, instituição de comissões para estudo de problemas específicos e outras ações administrativas e acadêmicas. Contém, em geral, documentos que tratam de assuntos relativos à administração geral: modernização e reforma administrativa, planos e programas de trabalho, relatórios de atividades, regimentos e regulamentos, estatutos e organogramas.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,527,'pt_BR'),('Atos, Resoluções e Instruções da Reitoria',NULL,NULL,NULL,NULL,NULL,'Os documentos dessa série abrangem os atos, resoluções e instruções emanados do Gabinete do Reitor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,533,'pt_BR'),('Atos da Reitoria',NULL,NULL,'Papel',NULL,NULL,'Conjunto dos Atos da Reitoria recolhidos ao Arquivo Central desde 1964.\nÉ possível encontrar também os Atos da Reitoria dos anos de 2016 e 2017.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,534,'pt_BR'),('Atos da Reitoria 1995',NULL,NULL,'Papel.',NULL,NULL,'Dossiê composto pelos Atos da Reitoria do ano de 1964. Nesse dossiê encontra-se apena o Ato da Reitoria Nº 29/64, que trata sobre a criação de secretarias administrativas no âmbito de algumas unidades acadêmicas. Os atos restantes não foram recuperado/ enviados ao Arquivo Central.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,536,'pt_BR'),('Ato da Reitoria N° 1/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,537,'pt_BR'),('Ato da Reitoria N° 2/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,541,'pt_BR'),('Ato da Reitoria N° 3/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,545,'pt_BR'),('Ato da Reitoria N° 4/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,549,'pt_BR'),('Ato da Reitoria N° 5/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,553,'pt_BR'),('Vida acadêmica dos alunos dos cursos de graduação',NULL,NULL,NULL,NULL,NULL,'A documentação custodiada pelo Arquivo Permanente da UAVMB conta com documentos acadêmicos referentes à vida acadêmica dos estudantes e necessários para comprovar seus estudos. Existem no fundo diplomas, histórico escolar, dentre outros documentos necessários a comprovação da graduação.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,557,'pt_BR'),('Documentação Acadêmica',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,559,'pt_BR'),('Emissão de Diploma',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,560,'pt_BR'),('Registro',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,561,'pt_BR'),('Aluno Daenerys Targaryen',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,586,'pt_BR'),('Aluno Isadora Rios Souza',NULL,NULL,'Documentos',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,602,'en'),('Graduação AVMB',NULL,NULL,'Dimensão: 10 metros lineares\nSuporte: Papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,937,'pt_BR'),('Curso Ciência da Computação',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,938,'en'),('Departamento de Ciência da Informação',NULL,NULL,'Dimensão: 3 metros lineares\nSuporte: papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,938,'pt_BR'),('Documentação Acadêmica',NULL,NULL,'Dimensão: 1 metro linear\nSuporte: papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,940,'pt_BR'),('Assentamentos Indi